import ActionHome from 'material-ui/svg-icons/action/home'
import React from 'react'
import Navbar from './Components/Navbar'
import './port.css'
function PortfolioApp() {
    return (
        <div className="portApp">
            <Navbar/>
            <ActionHome/>
        </div>
    )
}

export default PortfolioApp
